import React from 'react';
import styled from 'styled-components';

const FilterDiv = styled.div`
  position: absolute;
  width: 100%;
  transform: translateX(50%);

  .filter-item {
    &__name {
    }

    &__content {
      visibility: hidden;
    }
  }
`;

function Filters() {
  return (
    <FilterDiv>
      <div className="filter-item">
        <div className="filter-item__name">cena</div>
        <div className="filter-item__content">0 zł - 9999 zł</div>
      </div>
    </FilterDiv>
  );
}

export default Filters;
